No it doesn't. phosphor-multi-gpio-presence doesn't create the interface, nor does it change the interface. It's the same behaviour as with phosphor-gpio-presence.

When it calls `Notify` on xyz.openbmc_project.Inventory.Manager the inventory service will generate a `PropertyChanged` though:

busctl monitor on SBP1:
```
> Type=method_call  Endian=l  Flags=0  Version=1 Cookie=3  Timestamp="Wed 2023-10-11 07:04:13.226005 UTC"
  Sender=:1.529  Destination=xyz.openbmc_project.Inventory.Manager  Path=/xyz/openbmc_project/inventory  Interface=xyz.openbmc_project.Inventory.Manager  Member=Notify
  UniqueName=:1.529                                           
  MESSAGE "a{oa{sa{sv}}}" {
          ARRAY "{oa{sa{sv}}}" {   
                  DICT_ENTRY "oa{sa{sv}}" {
                          OBJECT_PATH "/system/chassis/motherboard/dimm_c0e2";
                          ARRAY "{sa{sv}}" {
                                  DICT_ENTRY "sa{sv}" {
                                          STRING "xyz.openbmc_project.Inventory.Item";
                                          ARRAY "{sv}" {
                                                  DICT_ENTRY "sv" {
                                                          STRING "Present";
                                                          VARIANT "b" {
                                                                  BOOLEAN true;
                                                          };                                            
                                                  };                                                                                                    
                                                  DICT_ENTRY "sv" {
                                                          STRING "PrettyName";
                                                          VARIANT "s" {
                                                                  STRING "DIMM_C0E2";
                                                          };
                                                  };
                                          };
                                  };                                 
                          };
                  };
          };
  }; 

> Type=signal  Endian=l  Flags=1  Version=1 Cookie=1409  Timestamp="Wed 2023-10-11 07:04:13.230415 UTC"
  Sender=:1.56  Path=/xyz/openbmc_project/inventory/system/chassis/motherboard/dimm_c0e2  Interface=org.freedesktop.DBus.Properties  Member=PropertiesChanged
  UniqueName=:1.56                                                                                                                                           
  MESSAGE "sa{sv}as" {                                                                                                                                       
          STRING "xyz.openbmc_project.Inventory.Item";                                                                                                       
          ARRAY "{sv}" {                                                                                                                                     
                  DICT_ENTRY "sv" {                   
                          STRING "Present";           
                          VARIANT "b" {               
                                  BOOLEAN true;
                          };                                         
                  };                           
          };                                   
          ARRAY "s" {                          
          };                
  }; 
```

As you can see the `Sender` is different, the functionality is still given and dbus-sensors should see the PropertiesChanged.
